() => {
  const monthRe = /(January|February|March|April|May|June|July|August|September|October|November|December)/i;
  const candidates = Array.from(document.querySelectorAll('body *'))
    .map(el => (el.textContent || '').replace(/\s+/g,' ').trim())
    .filter(Boolean)
    .filter(t => t.length <= 40)
    .filter(t => monthRe.test(t) && /20\d{2}/.test(t));
  const best = candidates.find(t => /\b\d{1,2}\b/.test(t) && /-/.test(t)) || candidates[0] || null;
  return { candidates: candidates.slice(0, 10), best };
}

