() => {
  const candidates = Array.from(document.querySelectorAll('a,button,[role="tab"]'));
  const tab = candidates.find(el => (el.textContent || '').trim().toLowerCase() === 'rankings');
  if (!tab) return { clicked: false, reason: 'Rankings tab not found', sample: candidates.slice(0,20).map(e => (e.textContent||'').trim()).filter(Boolean).slice(0,20) };
  tab.click();
  return { clicked: true, tag: tab.tagName, text: (tab.textContent||'').trim() };
}

